import { setLimits } from './limitsSlice';

const mockData = {
  maxBet: 100,
  minBet: 1,
  maxWin: 5000,
  currency: 'USD',
};

export const getLimitsData = () => async dispatch => {
  try {
    // Simulate an API request delay with setTimeout
    dispatch(setLimits(mockData));
  } catch (error) {
    throw new Error('Error fetching limits data');
  }
};
